package ass;

public class Divisibility {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int no=55;
		
		if ((no%5==0)&&(no%11==0))
		{
			System.out.println("Number is divisible by 5 and 11");
		}
		else
		{
			System.out.println("Number is not Divisible by 5 and 11");
		}
	}

}
